import React from "react";
import {RequestStatus} from "../../../model/consts/RequestStatus";
import {isAuthorized} from "../../../services/AuthService";
import {BookID} from "../../../model";
import {Button, Typography} from "@material-ui/core";
import Loader from "../../../components/Loader/Loader";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import SweetAlert from "react-bootstrap-sweetalert";
import {RouteComponentProps, withRouter} from "react-router";
import {getBookData, deleteBook} from "../../../services/BookService";
import {Author} from "../../../model/Author";
import BookView from "./BookView";
import "./Book.css"

interface BookProps extends RouteComponentProps<MatchParams> {
    loadAvatarErrorCallback(): void,
}

interface BookState {
    isAdmin: boolean,
    getBookDataStatus: RequestStatus,
    updateStatus: any,
    deleteStatus: any,
    showDelete: boolean,
    data: {
        id: string,
        title: string,
        genre: string,
        date: Date,
        photo: string,
        language: string,
        stars: number,

    },
    authors: Author[],
    error: any,
}

interface MatchParams {
    id: string,
}


class Book extends React.Component<BookProps, BookState> {
    constructor(props: BookProps) {
        super(props);
        this.state = {
            getBookDataStatus: RequestStatus.NONE,
            isAdmin: isAuthorized(["ROLE_ADMIN"]),
            data: {
                id: this.props.match.params.id,
                title: 'Titulito',
                genre: 'Romanticismo',
                date: new Date(),
                photo: "",
                language: 'Espaol',
                stars: 3.5,

            },
            authors: [
                {
                    id: 122,
                    firstName: "Jorge Ricardo",
                    lastName: "Lopez",
                    nationality: "Argentina",
                    birthday: new Date(),
                    photo: "R0lGODlhEAAOALMAAOazToeHh0tLS/7LZv/0jvb29t/f3//Ub//ge8WSLf/rhf/3kdbW1mxsbP//mf///yH5BAAAAAAALAAAAAAQAA4AAARe8L1Ekyky67QZ1hLnjM5UUde0ECwLJoExKcppV0aCcGCmTIHEIUEqjgaORCMxIC6e0CcguWw6aFjsVMkkIr7g77ZKPJjPZqIyd7sJAgVGoEGv2xsBxqNgYPj/gAwXEQA7",
                },
                {
                    id: 123,
                    firstName: " Ricardo",
                    lastName: "Arjona",
                    nationality: "Argentina",
                    birthday: new Date(),
                    photo: "R0lGODlhEAAOALMAAOazToeHh0tLS/7LZv/0jvb29t/f3//Ub//ge8WSLf/rhf/3kdbW1mxsbP//mf///yH5BAAAAAAALAAAAAAQAA4AAARe8L1Ekyky67QZ1hLnjM5UUde0ECwLJoExKcppV0aCcGCmTIHEIUEqjgaORCMxIC6e0CcguWw6aFjsVMkkIr7g77ZKPJjPZqIyd7sJAgVGoEGv2xsBxqNgYPj/gAwXEQA7",
                },
            ],
            showDelete: false,
            updateStatus: RequestStatus.NONE,
            deleteStatus: RequestStatus.NONE,
            error: null,
        }
    }

    componentDidMount() {
        // this.setState({...this.state, getBookDataStatus: RequestStatus.LOADING});
        // getBookData({id: this.state.data.id})
        //     .then((response: any) => this.setState({
        //         data: response.data,
        //         getBookDataStatus: RequestStatus.SUCCESS
        //
        //     }))
        //     .catch((error: any) => this.setState({...this.state, getBookDataStatus: RequestStatus.ERROR, error}));
    }

    handleCancel = () => {
        this.setState({showDelete: false})
    };

    handleEdit = () => {
        const id = this.state.data.id;
        this.props.history.push(`/books/edit/${id}`)
    }

    handleDelete = () => {
        this.setState({showDelete: true})
    }

    handleConfirmDelete = () => {
        this.deleteBook({id: this.state.data.id});
    }


    deleteBook = (values: BookID) => {
        this.setState({deleteStatus: RequestStatus.LOADING, error: null});
        deleteBook(values)
            .then(() => {
                this.setState({deleteStatus: RequestStatus.SUCCESS, error: null});
                this.props.history.push("/") //Push to home?

            })
            .catch((error) => {
                this.setState({deleteStatus: RequestStatus.ERROR, error});
                //console.log("Error deleting", error)
            });
        this.handleCancel()
    }


    render() {
        return (
            <div className='route-container'>
                <div className='card-container'>
                    {this.renderButtons()}
                    {this.renderBook()}
                    {this.renderDelete()}
                </div>
            </div>


        );
    }

    /**
     * Renders AuthorView or AuthorEdit
     */

    renderBook() {
        const {data, getBookDataStatus, authors} = this.state;
        if (getBookDataStatus === RequestStatus.LOADING) {
            return (
                <div>
                    <Typography align='center' variant='subtitle1'> <Loader/> </Typography>
                </div>
            );
        }
        return (
            <BookView
                data={data}
                authors={authors}
                error={getBookDataStatus === RequestStatus.ERROR}
            />
        );
    }

    renderButtons() {
        const {isAdmin} = this.state;
        if (isAdmin)
            return (
                <div className="button-divider">
                    <ButtonGroup variant="contained" color="secondary" aria-label="contained primary button group">
                        <Button onClick={this.handleEdit}>Edit book</Button>
                        <Button onClick={this.handleDelete}>Delete book</Button>
                    </ButtonGroup>
                </div>
            )
    }

    renderDelete() {
        const {showDelete} = this.state;
        if (showDelete) return (
            <SweetAlert
                danger
                showCancel
                confirmBtnText="Yes, delete it!"
                confirmBtnBsStyle="danger"
                title="Are you sure?"
                onConfirm={this.handleConfirmDelete}
                onCancel={this.handleCancel}
                focusCancelBtn
            >
                Author will be permanently deleted
            </SweetAlert>
        )
    }


}

export default withRouter(Book);